def plot(x,y,linestyle, label):
    plt.plot(x, y, linestyle, label=label)
    plt.legend()        # label


def ply(name, style):
    x_axis_data = [i for i in range(len(name[0]))]  # x

    plot(x=x_axis_data, y=name[0], linestyle=style, label='ce')
    plot(x=x_axis_data, y=name[1], linestyle=style, label='topk loss')
    plot(x=x_axis_data, y=name[2], linestyle=style, label='focal loss')
    plot(x=x_axis_data, y=name[3], linestyle=style, label='DPCE loss')
    plot(x=x_axis_data, y=name[4], linestyle=style, label='Dice loss')
    plot(x=x_axis_data, y=name[5], linestyle=style, label='lovasz loss')
    plot(x=x_axis_data, y=name[6], linestyle=style, label='tversky loss')
    plot(x=x_axis_data, y=name[7], linestyle=style, label='GDice loss')
    plot(x=x_axis_data, y=name[8], linestyle=style, label='Asym loss')
    # plot(x=x_axis_data, y=name[9], linestyle=style, label='PGDice loss')
    # plot(x=x_axis_data, y=name[10], linestyle=style, label='Boundary loss')
    # plot(x=x_axis_data, y=name[11], linestyle=style, label='Hausdorff loss')
    plot(x=x_axis_data, y=name[12], linestyle=style, label='sensitivity specificity loss')
    plot(x=x_axis_data, y=name[13], linestyle=style, label='focal tversky loss')
    plot(x=x_axis_data, y=name[14], linestyle=style, label='Classification Loss')
    plot(x=x_axis_data, y=name[15], linestyle=style, label='wce loss')

